import manageJss from "@microsoft/fast-jss-manager-react";
import { ActionTriggerStyles, } from "@microsoft/fast-components-styles-msft";
import MSFTActionTrigger, { ActionTriggerAppearance, } from "./action-trigger";
import actionTriggerSchema from "./action-trigger.schema";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const ActionTrigger = manageJss(ActionTriggerStyles)(MSFTActionTrigger);
export { ActionTrigger, ActionTriggerAppearance, actionTriggerSchema, };
